R["oh__@withmylasergun"]="{['Key']='oh__@withmylasergun',['eu']={[36]={['O']=18941,['N']='Party Palace',['D']='A perfect place to rest on your laurels for a while, let down your hair and have a great party!\\n\\nThe Party Palace is fully equipped with:\\n\\n*A raised outdoor duelling arena above the ruins of the palace\\'s front courtyard\\n*A feast table fit for several Kings\\n*A meeting area for the planners and plotters of Nirn\\n*A pool to relax in and soak your scales\\n*A Disco\\n*A custom-built, floating bar\\n* A mini theatre\\n& more!\\n\\nPlease DM me if you have any questions :) \\n\\nEnjoy, \\n\\nLaser',['C']=1.018000,},[81]={['O']=18941,['N']='Botanic Garden',['D']='Aurey\\'s Botanic Garden and Bed & Breakfast. Come stay a while in the beautiful Western Skyrim, eat some tasty food and sleep in a comfy bed.\\r\\n\\r\\nStudy the various plants from all over Tamriel and read from our lengthy collection in the botanical library.\\r\\n\\r\\nAny questions please DM me, \\r\\n\\r\\nEnjoy, \\r\\n\\r\\nLaser\\r\\n',['C']=1.021000,},[70]={['O']=18941,['N']='Airship',['D']='Runs-Like-Clockwork\\'s Airship and workshop home.\\r\\n\\r\\nThis lucky Lizard travels by air all over Tamriel; digging up artifacts, buying and selling luxury goods, fearlessly delving into perilous adventures and trading with folk from all over the continent.\\r\\n\\r\\nWhen they come home tired from travels and trading, a cosy, secluded home awaits in the hills of Elsweyr.\\r\\n\\r\\nPlease DM if you have any questions, \\r\\n\\r\\nEnjoy, \\r\\n\\r\\nLaser :)\\r\\n',['C']=1.027000,},},['TS']=1636506739,['Version']=1766,}"
