R["oh__@katchlight"]="{['Key']='oh__@katchlight',['Version']=1766,['TS']=1635958957,['eu']={[49]={['O']=18934,['N']='The Glass Garden',['D']='Welcome to The Glass Garden.\\nHere the Blackheart Witch keeps her stolen Wardens, feeding on their life-power for years to keep herself immortal. The Wardens live here in ignorant bliss, unknowlingly tending to the garden grown from the remnants of their predesessors... The Glass Garden is a prison of wonder and beauty. Alas, it is still a prison. ',['C']=1.021000,},[91]={['O']=18931,['N']='Sorcerers Sanctuary',['D']='The Sorcerers Sanctuary, a place of peace and meditation for study of the arcane and astronomical. ',['C']=1.020000,},[15]={['O']=18902,['N']='The Ancient Villiage',['D']='Explore the ancient city, still very much alive with trade and intrigue. Walk the Moon Willow Gardens, find where the cultists meet above the city, follow the thief to find out why she is so sad and discover the dark secret kept by the villiage elder. There are endless things to experience for those patient enough to look...',['C']=1.041000,},[47]={['O']=18927,['N']='Necromancers Home',['D']='Explore the Necromacers castle at your own risk...',['C']=1.017000,},[70]={['O']=18902,['N']='Rimmen Temple',['D']='Explore the ancient villiage, still very much alive with trade and intrigue. Walk the Moon Willow Gardens, find where the cultists meet high above the city to plot, and discover the dark secret kept by the villiage elder. This little gem of exploration has many many things to find for those patient enough to look...',['C']=1.041000,},[71]={['O']=18845,['N']='Elsweyr Meadow',['D']='Swim murky waters to discover the ruins of an ancient city, the burial site of the Pale Saint. The last Nightbreaker who gave his life to defeat a creature of the greatest darkness. \\nHere, the Alchemist built his home in the giant cave and dedicates every waking breath to discovering the secret power hidden in the mysterious blossoms that grow around the grave of the Pale Saint.',['C']=1.020000,},},}"
