R["fx__na__@ivelbob__72"]="{['Version']=1766,['TS']=1635860177,['Effects']={[1]={['Pitch']=2.356194,['Y']=11616,['MetaData']={['message']='The long trail that led me here was littered with clues to solving the puzzle box and how it would open my mind to all knowledge under Heaven.\\n\\nThe last occultist I found had a different story - that the Lament Configuration is a doorway to Hell, and the knowledge it promises is only of pain. Its teachers are the Cenobites, whose gift is to remake your flesh in their twisted image. \\n\\nThose were his last words before I slit his throat and wrenched the box from his hands.  ',['title']='Bloodstained Journal',},['Id']=1177,['Contrast']=1,['Groups']=0,['SizeY']=30,['Color']=352473,['Z']=75414.886325,['SizeZ']=30,['X']=77406.842485,['Roll']=0,['Yaw']=3.590142,['SizeX']=26.456456,['EffectType']=8501,['Alpha']=1,},[2]={['Pitch']=0,['Y']=11432,['MetaData']={['message']='\"I slice away fear and weaknes, to reveal the art underneath. Your new face will inspire a religious epiphany.\" ',['title']='Cenobite Flesh Sculptor',},['Id']=1182,['Contrast']=1,['Groups']=0,['SizeY']=330,['Color']=102439,['Z']=80311.789214,['SizeZ']=330,['X']=78171.175781,['Roll']=0,['Yaw']=2.403318,['SizeX']=246.456456,['EffectType']=8501,['Alpha']=1,},[3]={['Pitch']=0,['Y']=11432,['MetaData']={['message']='\"Behold the newest of our number. The surgery is complete. His new limbs will wield knives in the service of Hell.\" ',['title']='Cenobite Angel of the Needle',},['Id']=1184,['Contrast']=1,['Groups']=0,['SizeY']=330,['Color']=102439,['Z']=80371.538347,['SizeZ']=330,['X']=79207.648306,['Roll']=0,['Yaw']=1.007055,['SizeX']=246.456456,['EffectType']=8501,['Alpha']=1,},[4]={['Pitch']=0,['Y']=11471,['MetaData']={['message']='\"Once your transformation is complete, the parts you have no more use for will go into my Flesh Gardens to spawn new glories. Hell abhors waste.\" ',['title']='Cenobite Abomination Mother',},['Id']=1185,['Contrast']=1,['Groups']=0,['SizeY']=230,['Color']=102439,['Z']=79141.241772,['SizeZ']=230,['X']=79529.551195,['Roll']=0,['Yaw']=3.302163,['SizeX']=86.456456,['EffectType']=8501,['Alpha']=1,},[5]={['Pitch']=0,['Y']=11963,['MetaData']={['message']='\"Do you desire the secrets of Heaven and Hell, mortal? We can open your eyes to them. Surgically, if necessary.\" ',['title']='Cenobite Blade Saint',},['Id']=1186,['Contrast']=1,['Groups']=0,['SizeY']=230,['Color']=102439,['Z']=78632.170609,['SizeZ']=230,['X']=77194.412864,['Roll']=0,['Yaw']=6.215117,['SizeX']=66.456456,['EffectType']=8501,['Alpha']=1,},[6]={['Pitch']=0,['Y']=13257,['MetaData']={['message']='\"You will enjoy it when I make you bleed. Come, taste our pleasures.\"',['title']='Cenobite Hellpriest',},['Id']=1187,['Contrast']=1,['Groups']=0,['SizeY']=290,['Color']=102439,['Z']=79541.677886,['SizeZ']=290,['X']=81945.569998,['Roll']=0,['Yaw']=5.696755,['SizeX']=126.456456,['EffectType']=8501,['Alpha']=1,},[7]={['Pitch']=0,['Y']=9235,['MetaData']={['message']='You have come to the end. Now, I have eternity to know your flesh.',['name']='Pinhead',},['Id']=1188,['Contrast']=1,['Groups']=0,['SizeY']=235,['Color']=696968,['Z']=87281.256199,['SizeZ']=235,['X']=84866.638459,['Roll']=0,['Yaw']=2.666863,['SizeX']=90,['EffectType']=5010,['Alpha']=1,},[8]={['Pitch']=0,['Y']=11289,['MetaData']={['message']='You open the box. You come to us willingly. Leave all memory of Heaven behind. We have such delights to infllict upon your flesh! ',['name']='Pinhead',},['Id']=1189,['Contrast']=1,['Groups']=0,['SizeY']=235,['Color']=696969,['Z']=76940.496637,['SizeZ']=235,['X']=78617.607998,['Roll']=0,['Yaw']=3.536037,['SizeX']=90,['EffectType']=5010,['Alpha']=1,},},}"
