['Contrast']=1,['Alpha']=1,['Z']=58871,['SizeY']=1700,['X']=62308,['Yaw']=0,},[19]={['Id']=1146,['Pitch']=0,['Groups']=0,['Color']=999999,['SizeX']=1500,['EffectType']=455,['Y']=13063,['Roll']=0,['SizeZ']=1300,['Contrast']=1,['Alpha']=1,['Z']=56744,['SizeY']=1300,['X']=62898,['Yaw']=0.352557,},[20]={['Id']=1154,['Pitch']=0,['Groups']=0,['Color']=101999,['SizeX']=955,['EffectType']=824,['Y']=13113,['Roll']=0,['SizeZ']=1045,['Contrast']=1,['Alpha']=1,['Z']=58883,['SizeY']=1045,['X']=60521,['Yaw']=2.185152,},[21]={['Id']=1175,['Pitch']=0,['Groups']=0,['Color']=999999,['SizeX']=6600,['EffectType']=601,['Y']=13077,['Roll']=0,['SizeZ']=6775.102041,['Contrast']=1,['Alpha']=1,['Z']=62441,['SizeY']=6775.102041,['X']=99334,['Yaw']=5.326745,},[22]={['SizeZ']=80,['Y']=7292,['Pitch']=0,['Groups']=0,['Z']=65124,['SizeX']=580,['EffectType']=4403,['Id']=1206,['Roll']=0,['MetaData']={['message']='Palast eines Clans einer ehemaligen Kaiserin.\\n   Palace of a Clan of a former Empress.\\n Palais du clan d\\'une ancienne imperatrice.',},['Contrast']=1,['Alpha']=1,['SizeY']=80,['Color']=9935,['X']=72534,['Yaw']=0.352557,},[23]={['SizeZ']=100,['Y']=11761,['Pitch']=0,['Groups']=0,['Z']=64254,['SizeX']=2100,['EffectType']=4403,['Id']=1207,['Roll']=0,['MetaData']={['message']='Palast eines Clans einer ehemaligen Kaiserin. -  Palace of a Clan of a former Empress. -  Palais du clan d\\'une ancienne imperatrice.',},['Contrast']=0.920000,['Alpha']=1,['SizeY']=100,['Color']=990100,['X']=76015,['Yaw']=1.937315,},[24]={['SizeZ']=160,['Y']=7132,['Pitch']=0,['Groups']=0,['Z']=65238,['SizeX']=340,['EffectType']=4403,['Id']=1209,['Roll']=0,['MetaData']={['message']='Kalryssia was temporarily Empress of Cyrodiil on 11.05.2019.\\n\\nWhen Kalryssia, an imperial dragon knight, once again\\nsat on the throne of the empire, a dragon empress, so to\\nspeak, the war could have ended.\\n\\nMolag Bal could have been thrown out of Cyrodiil, order\\ncould have been restored. Reconstruction could have begun.\\nA Golden Age could have followed.\\n\\nBut regrettably, there were once again some nitpickers who\\npointed out that Kalryssia is not an heir to Alessia and\\ntherefore may not found a dynasty of Dragon Emperors.\\n\\nSo the people of the Empire can thank these\\nbean counters that Cyrodiil is still not at rest...',},['Contrast']=1,['Alpha']=1,['SizeY']=160,['Color']=8899,['X']=72204,['Yaw']=0.352557,},[25]={['SizeZ']=160,['Y']=7134,['Pitch']=0,['Groups']=0,['Z']=65111,['SizeX']=340,['EffectType']=4403,['Id']=1210,['Roll']=0,['MetaData']={['message']='Kalryssia war am 11.05.2019 voruebergehend Kaiserin von Cyrodiil.\\n\\nAls mit Kalryssia wieder eine kaiserliche Drachenritterin auf dem\\nThron des Kaiserreichs sass, also gewissermassen eine Drachen-\\nkaiserin, haette der Krieg beendet werden koennen.\\n\\nMolag Bal haette aus Cyrodiil herausgeworfen werden koennen, die\\nOrdnung haette wieder hergestellt werden koennen. Der Wieder-\\naufbau haette beginnen koennen. Ein Goldenes Zeitalter haette\\nfolgen koennen.\\n\\nDoch bedauerlicherweise gab es wieder einmal einige Erbsenzaehler,\\ndie darauf hinwiesen, dass Kalryssia kein Erbe von Alessia ist und\\ndaher keine Dynastie von Drachenkaisern begruenden darf.\\n\\nDas Volk des Kaiserreichs darf sich also bei diesen Erbsen-\\nzaehlern bedanken, dass Cyrodiil weiterhin nicht zur Ruhe kommt...',},['Contrast']=1,['Alpha']=1,['SizeY']=160,['Color']=8899,['X']=72535,['Yaw']=0.352557,},[26]={['SizeZ']=160,['Y']=7134,['Pitch']=0,['Groups']=0,['Z']=64980,['SizeX']=340,['EffectType']=4403,['Id']=1211,['Roll']=0,['MetaData']={['message']='Kalryssia a ete temporairement imperatrice de Cyrodiil le 11/05/2019.\\n\\nLorsque Kalryssia serait a nouveau un Chevalier Dragon Imperial\\nsur le trone de l\\'Empire, une Imperatrice Dragon en un sens, la\\nguerre aurait pu prendre fin.\\n\\nMolag Bal aurait pu etre chasse de Cyrodiil, l\\'ordre aurait pu etre\\nrestaure. La reconstruction aurait pu commencer. Un age d\\'or aurait\\npu suivre.\\n\\nMais malheureusement, il y a eu une fois de plus des compteurs de\\nharicots qui ont fait remarquer que Kalryssia n\\'est pas l\\'heritiere\\nd\\'Alessia et ne peut donc pas fonder une dynastie d\\'empereurs dragons.\\n\\nLe peuple de l\\'Empire peut donc remercier ces compteurs de haricots\\nque Cyrodiil continue à ne pas se reposer.....',},['Contrast']=1,['Alpha']=1,['SizeY']=160,['Color']=8899,['X']=72879,['Yaw']=0.352557,},[27]={['SizeZ']=40,['Y']=6992,['Pitch']=0,['Groups']=0,['Z']=65133,['SizeX']=420,['EffectType']=4401,['Id']=1212,['Roll']=0,['MetaData']={['message']='Kalryssia becomes Empress: https://youtu.be/HyAn9JD878o',},['Contrast']=1,['Alpha']=1,['SizeY']=40,['Color']=53799,['X']=72537,['Yaw']=0.352557,},[28]={['Id']=1213,['Pitch']=4.703662,['Groups']=0,['Color']=999900,['SizeX']=128,['EffectType']=546,['Y']=6842,['Roll']=0,['SizeZ']=128,['Contrast']=1,['Alpha']=1,['Z']=65227,['SizeY']=128,['X']=72560,['Yaw']=0.352557,},[29]={['Id']=1216,['Pitch']=0,['Groups']=0,['Color']=999999,['SizeX']=232.108317,['EffectType']=5047,['Y']=12166,['Roll']=0,['SizeZ']=150,['Contrast']=1,['Alpha']=1,['Z']=67240,['SizeY']=150,['X']=74181,['Yaw']=1.923353,},[30]={['Id']=1217,['Pitch']=0,['Groups']=0,['Color']=999999,['SizeX']=232.108317,['EffectType']=5045,['Y']=12171,['Roll']=0,['SizeZ']=150,['Contrast']=1,['Alpha']=1,['Z']=67471,['SizeY']=150,['X']=74472,['Yaw']=5.064945,},[31]={['Id']=1221,['Pitch']=0,['Groups']=0,['Color']=999999,['SizeX']=1500,['EffectType']=435,['Y']=12876,['Roll']=0,['SizeZ']=1500,['Contrast']=1,['Alpha']=1,['Z']=63971,['SizeY']=1500,['X']=72104,['Yaw']=1.923353,},[32]={['SizeZ']=120,['Y']=11105,['Pitch']=0,['Groups']=0,['Z']=67056,['SizeX']=200,['EffectType']=4403,['Id']=1230,['Roll']=0,['MetaData']={['message']='Willkommen in meiner grossen Psijik-Villa.\\nDieses Haus hat einen Hafen, ein Gewaechshaus,\\neinen Gaertner, der Mondzucker anbaut, einen\\nkleinen Modell-Wald und einen Teich mit\\nFischen darin. Gaebe es hier genuegend\\nBauplaetze, haette ich weitaus mehr Garten-\\nGestaltung betrieben.',},['Contrast']=1,['Alpha']=1,['SizeY']=120,['Color']=259995,['X']=80731,['Yaw']=2.834415,},[33]={['SizeZ']=120,['Y']=10965,['Pitch']=0,['Groups']=0,['Z']=67071,['SizeX']=200,['EffectType']=4403,['Id']=1231,['Roll']=0,['MetaData']={['message']='Welcome to my Grand Psijik Villa. This house\\nhas a harbor, a greenhouse  a gardener who\\ngrows moon sugar, a small model forest and\\na pond with fish in it. If there were enough\\nbuilding sites here, I would have done a lot\\nmore gardening.',},['Contrast']=1,['Alpha']=1,['SizeY']=120,['Color']=259995,['X']=80731,['Yaw']=2.834415,},[34]={['SizeZ']=120,['Y']=10825,['Pitch']=0,['Groups']=0,['Z']=67071,['SizeX']=200,['EffectType']=4403,['Id']=1232,['Roll']=0,['MetaData']={['message']='Bienvenue dans mon Grand Manoir Psijik. Cette maison\\ndispose d\\'un port, d\\'une serre, d\\'un jardinier qui fait\\npousser du sucre de lune, d\\'une petite foret modele et\\nd\\'un etang avec des poissons dedans. S\\'il y avait assez\\nde chantiers ici, j\\'aurais fait beaucoup plus de jardinage.',},['Contrast']=1,['Alpha']=1,['SizeY']=120,['Color']=259995,['X']=80731,['Yaw']=2.834415,},[35]={['Id']=1233,['Pitch']=0,['Groups']=0,['Color']=999999,['SizeX']=172,['EffectType']=5043,['Y']=12468,['Roll']=0,['SizeZ']=480,['Contrast']=1,['Alpha']=1,['Z']=75160,['SizeY']=480,['X']=73219,['Yaw']=2.272419,},[36]={['Id']=1242,['Pitch']=4.703662,['Groups']=0,['Z']=65521,['SizeX']=128,['X']=81682,['Y']=10629,['Roll']=0,['SizeZ']=128,['Contrast']=1,['Alpha']=1,['EffectType']=546,['SizeY']=128,['Color']=999900,['Yaw']=3.930481,},[37]={['SizeZ']=40,['Y']=10631,['Pitch']=4.712564,['Groups']=0,['Z']=65451,['SizeX']=300,['EffectType']=4403,['Id']=1243,['Roll']=0,['MetaData']={['message']=' kleiner Hafen - Treppe runter\\n  small Harbor - downstairs\\npetit Port en bas des escaliers',},['Contrast']=1,['Alpha']=1,['SizeY']=40,['Color']=619399,['X']=81599,['Yaw']=3.930481,},[38]={['SizeZ']=60,['Y']=119