 have lost my beloved mate, Grunda. Both taken by a terrible monster, a crocodile my clan hunted for years. My Grunda killed it, stabbed it in the brain, but she couldn\\'t save our son. She went to the Ashen Forge knowing she had failed to save him, but at least she is with him now... and forever.\\n\\nIf I had gone with them on that trip to the river, perhaps I could have been the one to kill that monster. But I did nothing to help my family; I was too busy plotting and training for future battles. The only hope I have now is that I will die a noble death one day and join my family at the Ashen Forge.\\n\\nMy mind is twisted with pain and longing and anger that Grunda robbed me of the chance to avenge my son\\'s death. How can I feel that way? My brave mate gave her life for our son... and I envy her and hate her for it! I am a sad, sorry, despicable excuse for a warchief.\\n\\nDrink and sleeping potions call to me at night. By day, I am trying to act as a warchief should for my men, but they are looking at me out of the sides of their eyes. They see my pain, they know my grief; they are worried, but they soldier on. I only pray for the Ashen Forge. This weakness in me cannot continue. I am putting the entire clan at risk by my behaviour, but I cannot see any light. The only light I see is the glow of the Ashen Forge somewhere in my future.',},['Groups']=0,},},['TS']=1614970521,['HouseId']=29,},[8]={['World']='na',['Version']='16.2.1',['Effects']={},['TS']=1615080342,['HouseId']=19,},[9]={['World']='na',['Version']='16.2.1',['Effects']={},['TS']=1615156068,['HouseId']=6,},},['Key']='fx__@jemimaturner',['TS']=1625710374,}"
