my thralls a good lifetime to build this place, a nice reclusive retreat, just what I had wished for - until you came along. It isn\\'t that I fear facing you in open battle, but you hounds never fight fair. Have you ever thought about what life free of the leash could be like? I doubt it. You all follow Danu blindly. She might be the oldest of us and the only survivor of the original council, but that does not mean we have to live our eternal life chained to her laws!\\n\\nHave the place, you earned it. How you found my trail I do not know, I spent much effort on erasing my tracks, heck, I even entered a bargain with Molag to change the very essence of my being, yet here we are.\\n\\nWhat is my crime? That I fathered a few bastard children in this realm? That I did not stick to my original assignments? Forget it, I am not going back to have Danu sit in judgment over me. Yes you found me once, but I shall make sure your nose will run bloody trying to sniff me out again. It is such a shame. You are by far the most talented of your shapeshifting pack, I actually really liked you once, we could have had fun, you and I, but your stupid loyalty to Danu makes you my enemy now, and next time we meet I shan\\'t run but kill you, with Molag\\'s help, I shall find a way to end your eternal existence.\\n\\n - Ghost, no longer a slave to the Tuath Dé and your idiotic dusty laws\\n\\n\\nPS.: Don\\'t have the pups defecate all over the beds or chew the table legs. I might be back eventually and would prefer to not find my home completely wrecked by your stupid pack!',},['Id']=1419,['Groups']=0,['X']=63081,['SizeZ']=48,['Z']=97878,['Pitch']=4.670501,['Contrast']=1,['Y']=19062,['Color']=102439,['Roll']=0,['Alpha']=1,['EffectType']=8501,['SizeY']=48,['SizeX']=46.456456,['Yaw']=3.577925,},[36]={['Z']=98023,['SizeX']=1103,['X']=64402,['SizeZ']=592,['Contrast']=1.580000,['Pitch']=6.272713,['Color']=63599,['Y']=19475,['Roll']=0,['Id']=1420,['Alpha']=0.640000,['EffectType']=407,['SizeY']=592,['Groups']=0,['Yaw']=3.602360,},[37]={['Z']=97645,['SizeX']=304,['X']=64824,['SizeZ']=592,['Contrast']=1.380000,['Pitch']=6.272713,['Color']=354699,['Y']=19479,['Roll']=0,['Id']=1421,['Alpha']=0.820000,['EffectType']=407,['SizeY']=592,['Groups']=0,['Yaw']=5.138249,},[38]={['Z']=98140,['SizeX']=291,['X']=63842,['SizeZ']=592,['Contrast']=1.380000,['Pitch']=6.272713,['Color']=354699,['Y']=19479,['Roll']=0,['Id']=1422,['Alpha']=0.820000,['EffectType']=407,['SizeY']=592,['Groups']=0,['Yaw']=5.187119,},[39]={['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Id']=1423,['Groups']=0,['X']=62391,['SizeZ']=182.250000,['Z']=97129,['Pitch']=0,['Contrast']=0.420000,['Y']=19576,['Color']=437,['Roll']=0,['Alpha']=1,['EffectType']=5162,['SizeY']=182.250000,['SizeX']=570,['Yaw']=0.443314,},[40]={['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Id']=1424,['Groups']=0,['X']=63980,['SizeZ']=169.250000,['Z']=94863,['Pitch']=0,['Contrast']=0.500000,['Y']=19588,['Color']=937,['Roll']=0,['Alpha']=1,['EffectType']=5162,['SizeY']=169.250000,['SizeX']=313,['Yaw']=2.143264,},[41]={['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Id']=1425,['Groups']=0,['X']=62443,['SizeZ']=178,['Z']=97084,['Pitch']=0,['Contrast']=0.620000,['Y']=19576,['Color']=333333,['Roll']=0,['Alpha']=1,['EffectType']=5151,['SizeY']=178,['SizeX']=408,['Yaw']=3.591888,},[42]={['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Id']=1426,['Groups']=0,['X']=62249,['SizeZ']=179,['Z']=97176,['Pitch']=0,['Contrast']=1.140000,['Y']=19575,['Color']=333333,['Roll']=0,['Alpha']=1,['EffectType']=5151,['SizeY']=179,['SizeX']=408,['Yaw']=3.577925,},[43]={['MetaData']={['title']='The Hound\\'s Report',['message']='Update on the last developments.\\n\\nAs I suspected, the target is still present in Tamriel, and the latest lead proved to finally bear success. He has been hiding in the border region between Rivenspire and Wrothgar, however, as I closed in on him, he vanished. I assume he must have a spy embedded in the village I arrived at, more than likely another naive girl, succumbed to his charms. Some things will never change about him, but he left me a note full of whiny ramblings and petty insults. In it he mentions that he has allied himself with Molag to change his essence. I would say this means we are now dealing with a vampire, more than likely of true blood. This would certainly explain why it has been such a challenging hunt, yet even as a true blood he appears to fear us.\\n\\nI have taken possession of this property. He claims in his note to have had it built for himself, and I have not found traces of any ordinary mortals. It lies very secluded, only reachable via boat, and the pups love it, plenty of space. I will leave them to guard, just in case he should try return, although I doubt it, not yet, he knows I can see, hear and smell through the pups senses.\\n\\nSpeaking of smell, we have greater advantage now. His vampiric change made it hard to track him while we searched for his old essence. Now I have his new scent, and shall pursue the prey accordingly.\\n\\nLeannán chose to explore Western Skyrim, has she not? Please ask her to keep eyes and ears open. From what I have heard, it appears a breeding ground for those bloodsuckers (and please tell Aurnia this is not meant as an insult to her). I shall keep my nose on the ground too. He won\\'t escape us forever.\\n\\n- Ana, loyal Hound to our beloved Lady Danu',},['Id']=1427,['Groups']=0,['X']=62970,['SizeZ']=30,['Z']=97822,['Pitch']=4.799655,['Contrast']=1,['Y']=19063,['Color']=102439,['Roll']=0,['Alpha']=1,['EffectType']=8503,['SizeY']=30,['SizeX']=26.456456,['Yaw']=2.356194,},[44]={['Z']=95132,['SizeX']=700,['X']=76984,['SizeZ']=900,['Contrast']=0.750000,['Pitch']=0.523599,['Color']=999999,['Y']=11951,['Roll']=0,['Id']=1428,['Alpha']=1,['EffectType']=608,['SizeY']=900,['Groups']=0,['Yaw']=4.974188,},[45]={['Z']=97173,['SizeX']=900,['X']=76174,['SizeZ']=700,['Contrast']=0.880000,['Pitch']=0.610865,['Color']=999999,['Y']=12031,['Roll']=0,['Id']=1429,['Alpha']=1,['EffectType']=609,['SizeY']=700,['Groups']=0,['Yaw']=3.054326,},[46]={['MetaData']={['title']='Ana\\'s Journal',['message']='I have written my report, and for now shall grant myself some time to breathe. I have been hunting this traitor day and night for so long, now I need to focus on training the next litter. I lost out on spending quality time with the little ones already, so this place is an unexpected gift to all of the pack. I have set the lures, so they learn to ignore the smell of blood. They are my next set of eyes and ears and noses, and they must not give in to distraction and temptation. The method is embarrassingly simple, truly, for a people as advanced as we are, but it has been tried and tested over and over, and sometimes the simplest solution is still the best.\\n\\nAt first I was disappointed that Ghost got away, but after some contemplation, I am actually looking forth to chasing him some more. Now that he has revealed his secret to me, I shall know better what to look for, yet there is this nagging question as to why did he reveal himself. Maybe he thought I\\'d figure it anyway, and I probably would have, but I can not help wonder if he is planning to set his own trap. He sure has found himself a powerful enough ally, so I certainly will have to watch my steps, but what is a hunt without some challenge? That my prey is smart and dangerous makes it considerably more thrilling.\\n\\nBut for now we shall enjoy the comforts of our new home. I am glad I have finally been able to deliver some results, and shall see if there will be any new orders, although I doubt there will be a change. He has to be caught and brought to justice. He can\\'t be left to run wild in this realm, considering all the knowledge he carries. He is a risk to us all, and must be eliminated.\\n\\n(((a letter from the fugitive as well as Ana\\'s report can be found on the upstairs table)))',},['Id']=1430,['Groups']=0,['X']=64480,['SizeZ']=50,['Z']=96411,['Pitch']=4.719370,['Contrast']=0.840000,['Y']=18301,['Color']=83869,['Roll']=0,['Alpha']=1,['EffectType']=8502,['SizeY']=50,['SizeX']=39.456456,['Yaw']=5.585054,},[47]={['Z']=97818,['SizeX']=59,['X']=63348,['SizeZ']=61,['Contrast']=0.360000,['Pitch']=0,['Color']=998969,['Y']=18231,['Roll']=0,['Id']=1431,['Alpha']=1,['EffectType']=462,['SizeY']=61,['Groups']=0,['Yaw']=4.712389,},[48]={['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Id']=1433,['Groups']=0,['X']=63968,['SizeZ']=157.500000,['Z']=94879,['Pitch']=0,['Contrast']=0.430000,['Y']=19582,['Color']=333532,['Roll']=0,['Alpha']=1,['EffectType']=5158,['SizeY']=157.500000,['SizeX']=284.750000,['Yaw']=5.284857,},[49]={['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Id']=1435,['Groups']=0,['X']=63469,['SizeZ']=3309,['Z']=97310,['Pitch']=1.570971,['Contrast']=0.580000,['Y']=19661,['Color']=999999,['Roll']=0,['Alpha']=1,['EffectType']=5119,['SizeY']=3309,['SizeX']=273,['Yaw']=2.076942,},[50]={['MetaData']={['pattern scale % (y)']=100,['pattern scale % (x)']=100,},['Id']=1436,['Groups']=0,['X']=64765,['SizeZ']=2211,['Z']=95600,['Pitch']=1.567306,['Contrast']=0.660000,['Y']=19659,['Color']=999999,['Roll']=0,['Alpha']=1,['EffectType']=5119,['SizeY']=2211,['SizeX']=273,['Yaw']=0.544543,},[51]={['Z']=96078,['SizeX']=380,['X']=61776,['SizeZ']=187,['Contrast']=0.770000,['Pitch']=0,['Color']=818181,['Y']=19392,['Roll']=0,['Id']=1438,['Alpha']=1,['EffectType']=168,['SizeY']=187,['Groups']=0,['Yaw']=5.204572,},[52]={['Z']=97329,['SizeX']=180,['X']=60844,['SizeZ']=146,['Contrast']=0.940000,['Pitch']=0.003491,['Color']=999999,['Y']=19306,['Roll']=0,['Id']=1439,['Alpha']=1,['EffectType']=166,['SizeY']=146,['Groups']=0,['Yaw']=2.052507,},[53]={['Z']=94498,['SizeX']=900,['X']=66340,['SizeZ']=1700,['Contrast']=0.860000,['Pitch']=4.712564,['Color']=37,['Y']=18110,['Roll']=0,['Id