, formerly known as Ohal\\'s Fortress.\\n\\nOnce a huge fortress towered upon this big platform, but it has since been reduced to nothing but dust. Ohal was a mighty daedric general who originally served Mehrunes Dagon, along with his clan, yet after Mehrunes was driven back from Nirn, Ohal changed allegiance and joined Molag Bal.\\n\\nThe Prince of Brutality welcomed the powerful, smart and ambitious Ohal along with his fierce clan, alas events, not all clear in every detail, led to the fall of his new mighty general, and neither his name nor that of his clan are even whispered now in Coldharbour.\\n\\nIt can be assume the fact Ohal and his clan found a living child within Coldharbour, a girl with unusual magical abilities, probably led to Ohal\\'s ruin.\\n\\nAt the age of 8, Alyael\\'s cultist parents decided to sacrifice their only daughter to Molag, however, the child managed to free itself from the binding spell, just as the blade began to slice into her chest. Dazed and panicked, the girl stumbled into a daedric portal, next finding herself in a cold and inhospitable place. 4 years Alyael survived undetected in Coldharbour, stealing flesh atronach parts and drinking Coldharbour water. She grew feral, and by the end she was hard to tell apart from the usual Soulshriven. Had chance not led to her capture, she probably would not have been able to resist the adverse effects of the poisoned waters for much longer.\\n\\nOhal realized the raw magical potential of the girl, as well as being unable to deny the human child a certain amount of respect for its incredible will. The girl, despite being undernourished, had fought his warriors teeth and claws before they finally had managed to knock her unconscious.',},['Id']=1300,['Groups']=0,['X']=83355,['SizeZ']=42,['Z']=84880,['Pitch']=4.733333,['Contrast']=0.840000,['Y']=36881,['Color']=993809,['Roll']=0,['Alpha']=1,['EffectType']=8502,['SizeY']=42,['SizeX']=30.456456,['Yaw']=3.424336,},[27]={['MetaData']={['title']='Ohal\\'s Ruined Estate - Part 2',['message']='Alyael was caged in the dungeon below this platform, with Ohal personally tending to her, and despite all the trauma, the child still harboured enough humanity to long for connection and eventually entrusted herself to Ohal\\'s care and guidance. Ironically it proved to be a daedra to show her the first kindness she had ever experienced, and she came to blindly love her daedric Master.\\n\\nYet drinking Coldharbour Water for years had done irreversible damage and it became clear Alyael would not be able to escape the fate of a mind shriven. It was then that Ohal decided to turn to his former Prince, Mehrunes, for aid. Mehrunes agreed to corrupt Alyael with his own essence, not unlike Molag creating true blood vampires. It was an experiment, which just as easily could have gone wrong, but Alyael once again proved able to survive what few could. The procedure turned her into a new creation, part human, part daedric, and.. something different.\\n\\nWhen Alyael returned from the Deadlands, Ohal and his clan were gone. The fortress had been destroyed and Molag had erected a statue of himself in its place. What exactly had come to pass, Alyael never found out, but Molag had clearly not been aware of the caves surrounding the platform, or not bothered with them, as Alyael found them untouched. She took possession of the platform and raised a protective barrier around it, now in full possession of her magical abilities - and more.\\n\\n Even without knowing the details, it has been clear that Ohal and his clan were cast into The Darkness, and Alyael has sworn revenge. She has created her own portal to Tamriel,  and with the help of illusion magic she will appear as just a normal young woman while wandering Tamriel, seeking to widen her knowledge, while biting her time and plotting...',},['Id']=1302,['Groups']=0,['X']=83292,['SizeZ']=42,['Z']=84899,['Pitch']=4.733333,['Contrast']=0.840000,['Y']=36881,['Color']=32399,['Roll']=0,['Alpha']=1,['EffectType']=8502,['SizeY']=42,['SizeX']=30.456456,['Yaw']=3.337070,},[28]={['MetaData']={['title']='Alyael\\'s Journal',['message']='I shall start a new journal, for I believe to finally have found what I have been seeking. Long enough it has taken me, but I guess when dealing with daedric princes, one must be willing to extend endless patience. One can not plot the fall of one of theirs like one would go about planning a dinner party in Tamriel.\\n\\nYet I do believe to have found the answer, and it appears so simple now, I can not believe I missed this for as long as I have, alas my excitement is dampened by the fact there is no guarantee my enthusiasm will be joined by the one I will have to involve, even if it appears logical that we should share.. let us say a certain interest in this subject...\\n\\nIf my eyes would still be human, I would say they\\'d by now be bleeding from all the abuse I have subjected them to, reading and reading and reading even more, but the torture has born fruit. I know now who I must seek as my ally. Mehrunes says he can not confront Molag in open warfare, even though that is what he is best at. A pity, I would have enjoyed such a show.. yet instead I shall turn to the one who wishes to see all souls returned to the void, which certainly can not happen if Molag enslaves all souls.\\n\\nSithis.. dread-father.. you MUST aid me...\\n\\nI believe now only you can help me take my revenge, but again I have to practise patience. I have to get this right, so you will not dismiss me.\\n\\nThe ritual.. I have to use the ritual, yet also need to alter it, send all the thoughts I have to you, so you can see my reasoning, for while our motivations surely differ, our goals clearly align.\\n\\n..and I know in time you will return, Master, you are not gone, and if my plan works, I am certain Mehrunes will reward us both...',},['Id']=1303,['Groups']=0,['X']=81283,['SizeZ']=49,['Z']=102292,['Pitch']=4.712564,['Contrast']=1,['Y']=34533,['Colo