p grew.\\n\\nThere is a portal leading to where the Aos Sí now dwell, yet only those attuned to its working are able to use it correctly. You can try find it, passing through it will not harm you, yet also not reveal its secrets to the ordinary Tamriel citizen...',},['Id']=1362,['Groups']=0,['X']=80421,['SizeZ']=50,['Z']=81316,['Pitch']=5.173156,['Contrast']=1,['Y']=25896,['Color']=326958,['Roll']=0,['Alpha']=1,['EffectType']=8503,['SizeY']=50,['SizeX']=37.456456,['Yaw']=1.780236,},[24]={['Z']=63483,['SizeX']=200,['X']=71856,['SizeZ']=500,['Contrast']=3.250000,['Pitch']=0,['Color']=379921,['Y']=27600,['Roll']=0,['Id']=1363,['Alpha']=1,['EffectType']=4499,['SizeY']=500,['Groups']=0,['Yaw']=0.261799,},[25]={['Z']=63539,['SizeX']=780,['X']=71861,['SizeZ']=1161,['Contrast']=3.500000,['Pitch']=1.483530,['Color']=719923,['Y']=27583,['Roll']=0,['Id']=1364,['Alpha']=1,['EffectType']=32,['SizeY']=1161,['Groups']=0,['Yaw']=0.185005,},[26]={['Z']=86556,['SizeX']=1300,['X']=78463,['SizeZ']=1300,['Contrast']=3.750000,['Pitch']=0,['Color']=635699,['Y']=36925,['Roll']=0,['Id']=1366,['Alpha']=1,['EffectType']=946,['SizeY']=1300,['Groups']=0,['Yaw']=3.141593,},[27]={['Z']=76826,['SizeX']=340,['X']=76080,['SizeZ']=500,['Contrast']=1.900000,['Pitch']=0,['Color']=10417,['Y']=23515,['Roll']=0,['Id']=1367,['Alpha']=1,['EffectType']=644,['SizeY']=1000,['Groups']=0,['Yaw']=5.955063,},[28]={['Z']=76627,['SizeX']=340,['X']=76138,['SizeZ']=500,['Contrast']=2.440000,['Pitch']=4.712564,['Color']=31039,['Y']=23775,['Roll']=0,['Id']=1368,['Alpha']=1,['EffectType']=644,['SizeY']=1000,['Groups']=0,['Yaw']=5.955063,},},['World']='eu',['TS']=1600204775,['Version']='15.4.7',},[6]={['HouseId']=49,['Effects']={[1]={['Z']=48846,['SizeX']=4000,['X']=65050,['SizeZ']=4000,['Contrast']=0.460000,['Pitch']=0,['Color']=999536,['Y']=10185,['Roll']=0,['Id']=1370,['Alpha']=1,['EffectType']=63,['SizeY']=1,['Groups']=0,['Yaw']=4.712389,},[2]={['Z']=50226,['SizeX']=76,['X']=62170,['SizeZ']=70,['Contrast']=0.540000,['Pitch']=0,['Color']=395555,['Y']=10771,['Roll']=0,['Id']=1371,['Alpha']=1,['EffectType']=6009,['SizeY']=70,['Groups']=0,['Yaw']=2.167699,},[3]={['Z']=49849,['SizeX']=460,['X']=64034,['SizeZ']=200,['Contrast']=0.250000,['Pitch']=1.570971,['Color']=0,['Y']=10409,['Roll']=0,['Id']=1373,['Alpha']=1,['EffectType']=878,['SizeY']=200,['Groups']=0,['Yaw']=0.083776,},[4]={['MetaData']={['title']='Meadow\\'s Diary',['message']='It has been a year now since mother passed, and I miss her every day. I am certain few would believe a hag could make a good mother, but I could not have wished for a more loving upbringing. I arrived a wee baby, floating in a basket upon the waves, and she raised me with all the warmth and care my real mother obviously must not have felt for me.\\n\\nWhile mother led the coven, the hags around here were kinder. The new coven leader changed everything and even threatened mother and I. It hurt mother greatly to see her sisters turn on her, but at least we had each other.\\n\\nNow mother is gone, and I feel a longing to see more of the world. Mother\\'s old friend has moved into the hut, and he has agreed to look after everything. Not sure where I wish to go, maybe explore my wood elf roots, but I highly doubt they will welcome me. I was not raised by their rules and shall never find myself able to abide by them. Mother tried teach me some of it, but that\\'s just not the same.\\n\\nVery scary to think of the journey ahead, when the furthest I have ever been is the market in Daggerfall, but waking every morning missing mother so much is more than I can bear. I have to leave, I just have to, even though no matter where fate will lead me, I do know that this place will forever remain my most beloved home. Mother\\'s grave behind the hut makes certain of that, and all the wonderful childhood memories which will forever bind me to every pebble and every blade of grass...',},['Id']=1374,['Groups']=0,['X']=61882,['SizeZ']=35,['Z']=48682,['Pitch']=4.747296,['Contrast']=0.820000,['Y']=10588,['Color']=824,['Roll']=0,['Alpha']=1,['EffectType']=8501,['SizeY']=35,['SizeX']=26.456456,['Yaw']=0,},[5]={['Z']=50386,['SizeX']=154,['X']=63152,['SizeZ']=201,['Contrast']=0.880000,['Pitch']=0,['Color']=667799,['Y']=10685,['Roll']=0,['Id']=1375,['Alpha']=1,['EffectType']=240,['SizeY']=201,['Groups']=0,['Yaw']=3.965388,},},['World']='eu',['TS']=1600268594,['Version']='15.4.7',},[7]={['HouseId']=63,['Effects']={[1]={['Id']=1486,['SizeX']=8400,['X']=120492,['SizeZ']=3600,['Z']=118529,['Pitch']=0,['Contrast']=1.250000,['Y']=32676,['Color']=70559,['Roll']=0,['Alpha']=1,['EffectType']=984,['SizeY']=3600,['Groups']=0,['Yaw']=5.913176,},[2]={['Id']=1493,['SizeX']=2866.666667,['X']=129628,['SizeZ']=2100,['Z']=123133,['Pitch']=0,['Contrast']=3.250000,['Y']=33998,['Color']=999999,['Roll']=0,['Alpha']=1,['EffectType']=5085,['SizeY']=2100,['Groups']=0,['Yaw']=0.706858,},[3]={['Id']=1494,['SizeX']=2866.666667,['X']=129609,['SizeZ']=2100,['Z']=123060,['Pitch']=0,['Contrast']=3.160000,['Y']=33998,['Color']=999999,['Roll']=0,['Alpha']=1,['EffectType']=5085,['SizeY']=2100,['Groups']=0,['Yaw']=3.848451,},[4]={['Id']=1495,['SizeX']=540,['X']=125284,['SizeZ']=500,['Z']=118520,['Pitch']=0,['Contrast']=1,['Y']=37735,['Color']=999999,['Roll']=0,['Alpha']=1,['EffectType']=632,['SizeY']=500,['Groups']=0,['Yaw']=5.644395,},[5]={['MetaData']={['title']='Last Will',['message']='By the Nine, I didn\\'t think I\\'d end like this. I mean we all have to end, but killed trying to jump down from height to land in a puddle? I guess I shall leave my home and all that\\'s in it to my sister. Not that I like her much, but I like everyone else even less.\\n\\nWill Trailbeard\\n\\n*\\n\\nI can make it, I know I can and I shall, so why write a bloody will? Let the greedy horkers fight over it, just in case I can\\'t make it, but I will! I think...\\n\\nPete\\n\\n*\\n\\nI don\\'t want to jump! Curse all daedra and their princes! My poor William, what shall he do without me? He was never good at anything, the useless fool, he needs me to look after all the gold we got when his mother died. It is my gold now! I guess William would have it for himself, but what if I refuse to jump?\\n\\nSheogorath says he will push me, in fact he is saying he will push me right n..\\n\\n(unsigned)',},['Id']=1496,['Groups']=0,['X']=124629,['SizeZ']=30,['Z']=118892,['Pitch']=4.712564,['Contrast']=1,['Y']=37788,['Color']=102439,['Roll']=0,['Alpha']=1,['EffectType']=8503,['SizeY']=30,['SizeX']=26.456456,['Yaw']=0.516617,},[6]={['MetaData']={['title']='A Welcome Note from Sheogorath',['message']='\\nJump little birdie, jump! Or is it fly? Maybe it is both?\\n\\nLeap like you have never leaped before, with open arms, then bounce!\\n\\nBounce as if your life depends on it, although by that time you more than likely will have lost it, but nevermind that, what\\'s a little blood on the carpet?\\n\\nOr in the pool?\\n\\nYes in the pool! That was it! Leap and fly and bounce for Uncle Sheo, but not on Sweet Winter\\'s bed, her bed is not the pool, oh no it isn\\'t! And if she catches you, she shall turn you into a frog, for that could help with the leaping, yet not..\\n\\nthe flying!\\n\\n\\n((Feel free to use Sheo\\'s Bloody Pool Party for events. First to clear all jumps without dying - wins! <3))\\n',},['Id']=1497,['Groups']=0,['X']=131180,['SizeZ']=56,['Z']=124494,['Pitch']=4.799655,['Contrast']=3.940000,['Y']=33620,['Color']=997920,['Roll']=0,['Alpha']=1,['EffectType']=8503,['SizeY']=56,['SizeX']=33.456456,['Yaw']=0.242601,},[7]={['Z']=119840,['SizeX']=226,['X']=126194,['SizeZ']=167,['Contrast']=0.580000,['Pitch']=0,['Color']=697299,['Y']=24124,['Roll']=0,['Id']=1500,['Alpha']=1,['EffectType']=280,['SizeY']=167,['Groups']=0,['Yaw']=1.560324,},[8]={['Z']=119912,['SizeX']=60,['X']=127487,['SizeZ']=60,['Contrast']=1.880000,['Pitch']=0,['Color']=396599,['Y']=24301,['Roll']=0,['Id']=1501,['Alpha']=1,['EffectType']=981,['SizeY']=60,['Groups']=0,['Yaw']=5.508259,},},['Worl